import Navbar from "./Companent/Navbar";
import Body from "./Companent/Body";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (

      <div className="batman-store">
          <Navbar/>
          <BrowserRouter>
              <Routes>
                  <Route path="/" element={<Body />}>
                  </Route>
                  <Route path="/" element={<Body />}>
                  </Route>
              </Routes>
          </BrowserRouter>

      </div>
  );
}

export default App;
